import React, { Component } from 'react';
const { AccountClient } = require('../matcha_grpc_web_pb');
const { imageData } = require('../matcha_pb');


class Test extends Component {
	constructor(props) {
		super(props);
		this.state = {
			image: ''
		}
	}

	getImage = () => {
		const client = new AccountClient('http://10.43.1.110:8080');
		const request = new imageData();
		// request.getImage();
		client.imageTest(request, {}, (err, reply) => {
			if (err) {
				console.log(err.code);
				console.log(err.message);
			} else {
				// const data = reply.getImage();
				// const Example = ({ data }) => <img src={`data:image/jpeg;binary,${data}`} />
				// const Example = ({ data }) => <img src={`data:image/jpeg;base64,${data}`} />
				// ReactDOM.render(<Example data={data} />, document.getElementById('container'))
				const data = reply.getImage();
				this.setState({ image: data })
				const Example = ({ data }) => <img src={`data:image/jpeg;base64,${this.state.image}`} />
				return(Example);
			}

		})

	}

	render() {
		const a = this.getImage();


		return (
			<div>
				<a data={this.state.image} />
				{document.getElementById('container')}
				<div id="container"></div>
				<div>test page</div>
			</div>
		)
	}
}

export default Test;
